import { StyleSheet, Text, View } from 'react-native';
import Header from './components/Header';

export default function App() {
  return (
    <View style={styles.screen}>
      <Header title={"General Kenobi"}/>
    </View>
  );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1
  },
});
